function OrderConfirm({ orderDetails }) {
  console.log("order details in confirm: ", orderDetails);
  return (
    <div className="orderConfirm-section">
      <p>Thank you!</p>
      <h1 className="text-4xl text-left my-8">It's on the way!</h1>
      <p>Your order #2382038434 has shipped and will be with you soon.</p>

      <div className="grid grid-cols-3 my-8 border-t-2 py-4">
        <ul className="col-span-2">
          {/* {orderDetails.items.map((item) => (
          <OrderConfirmItem key={item.id} item={item} />
        ))} */}
          <OrderConfirmItem />
        </ul>

        <div className="text-left">
          <p>Name: Daniel Ndanema</p>
          <p>Email: dndanema@yahoo.com</p>
          <p>
            Address: Limkokwing University, Inovasi 1-1, Jalan Teknokrat 1/1,
            Off Jalan Apec, Cyberjaya, Selangor, Malaysia
          </p>
          <p>Payment Method: Credit</p>
        </div>
      </div>
      <div className="flex flex-col gap-8 w-1/2 border-t-2 py-4">
        <div className="flex justify-between">
          <span>Subtotal</span>
          <span>$36.00</span>
        </div>
      </div>
    </div>
  );
}

function OrderConfirmItem({ item }) {
  return (
    <div>
      {/* <li>{item.title}</li> */}
      <li>White T-shirt</li>
      <li>$20</li>
    </div>
  );
}

export default OrderConfirm;
